import EventItemHome from "../components/EventItemHome";
import HeroSection from "../components/HeroSection";

function HomePage() {
  return (
    (<h1>HomePage</h1>),
    (
      <div>
        <div>
          <HeroSection />
        </div>
      </div>
    )
  );
}

export default HomePage;
